The AssetCache is a very central concept to the internals of the engine. It should be thought of as a way to cache the result of slow operations - that is, a memoization cache. For example, let's say we have: fn generate_fractal(param1: bool, param2: u32) -> Image { // ...
} let fractal = generate_fractal(true, 5); This function is entirely pure - that is, its output is only dependent on its inputs, and it will always return the same output for the same inputs. However, it's also very slow to run. Instead of running it every time, the asset cache can be used to cache the result: #[derive(Debug, Clone)]
struct GenerateFractal { param1: bool, param2: u32 }
impl SyncAssetKey<Arc<Image>> for GenerateFractal { fn load(&self, assets: AssetCache) -> Arc<Arc<Image>> { // .. }
} let fractal = GenerateFractal { param2: true, param2: 5 }.get(&assets); The cache key is the debug format of GenerateFractal. This may change in the future, but it offers a simple way to construct a cache key for now.

