Hierarchies are commonly used for transforms where a root entity is moved around and all its children should move with it. To apply transforms to a hierarchy, local_to_parent must be used: entity a: - local_to_world: Mat4(..)
entity b: - parent: a - local_to_parent: Mat4(..) - local_to_world: Mat4(..) In this case, b.local_to_world will be calculated as a.local_to_world * b.local_to_parent. local_to_world and local_to_parent are the only matrices necessary here. However, it is often more convenient to work with translation, rotation and scale components: entity a: - local_to_world: Mat4(..) - translation: vec3(5., 2., 9.) - rotation: quat(..) - scale: vec3(0.5, 0.5, 1.)
entity b: - parent: a - local_to_parent: Mat4(..) - local_to_world: Mat4(..) - translation: vec3(-2., 0., 0.) - rotation: quat(..) - scale: vec3(1., 2., 1.) In this case, the local_to_world and local_to_parent will automatically be recalculated from translation, rotation and scale whenever they change; the following computations will happen in this order: a.local_to_world = mat4_from(a.scale, a.rotation, a.translation);
b.local_to_parent = mat4_from(b.scale, b.rotation, b.translation);
b.local_to_world = a.local_to_world * b.local_to_parent;
